            <div className="friend_container">
                <p1>test1</p1>
                <button>Send Friend Request</button>
                <hr/>
            </div>
            <div className="friend_container">
                <p1>test1</p1>
                <hr/>
            </div>
        </ul>
    </div>
  )
}

export default AddFriendContainer
